    elif args_method == "zero_shot_cot":
        k = x + " " + args_cot_trigger
    elif args_method == "few_shot" or args_method == "few_shot_cot":
        k = str(demo1) + x
    elif args_method == "auto_cot":
        k = str(demo1) + x + " " + args_cot_trigger
    else:
        raise ValueError("method is not properly defined ...")
    return k
